import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class Home extends Component {

  getUser(userId) {
    console.log(userId)
  }
  render() {
    return (
    <div className="App">
      <h1>Project Home</h1>
      {/* Link to List.js */}
      <Link to={'./list'}>
        <button variant="raised">
            My List
        </button>
        <div>
          {
            [1, 2, 3, 4, 5].map(value => (<button onClick={() => this.getUser(value)}>{value}</button>))
          }
        </div>
      </Link>
    </div>
    );
  }
}
export default Home;
